(9, 'vket_reservasi', '<h3><strong>Reservasi Online</strong></h3>\r\n\r\n<div style=\"background:#eee; border:1px solid #ccc; padding:5px 10px\"><strong>Ketentuan Reservasi</strong></div>\r\n\r\n<ol>\r\n <li>Reservasi Online dilakukan <strong>minimal H-3</strong> dan <strong>maksimal H-30</strong> sebelum hari pemeriksaan. Pasien <strong>WAJIB</strong> <strong>datang sebelum jam praktik dimulai untuk melakukan verifikasi</strong> di loket pendaftaran pada hari H pemeriksaan.</li>\r\n <li>Khusus Pasien Peserta BPJS Kesehatan wajib melakukan<strong> Finger Print</strong> (untuk poliklinik tertentu sesuai aturan BPJS Kesehatan yang berlaku).</li>\r\n <li>Bila ada perubahan jadwal (sesuai konfirmasi dokter yang bersangkutan) Layanan Pelanggan kami akan menghubungi anda via telepon / SMS / WhatsApp (dimohon mencantumkan <strong>nomor ponsel yang aktif</strong> saat melakukan reservasi).</li>\r\n <li>Seluruh Reservasi yang bertepatan dengan <strong>Hari Libur Nasional &amp; Cuti Bersama</strong> akan <strong>dibatalkan secara otomatis oleh sistem</strong>. Silahkan <strong>melakukan penjadwalan ulang di Resepsionis</strong> dengan menunjukkan Bukti Reservasi.</li>\r\n</ol>\r\n\r\n<p>silahkan cek nomor Layanan Pelanggan / <em>Hotline Center</em> kami <a href=\"http://hospital.umm.ac.id/page/kontak.html\"><em>di sini</em></a></p>\r\n\r\n<div style=\"background:#eee; border:1px solid #ccc; padding:5px 10px\"><strong>Persyaratan Administrasi</strong></div>\r\n\r\n<ul>\r\n <li>Kartu Pasien / Kartu Berobat Asli (memiliki <em>BARCODE bagi pasien lama</em>)</li>\r\n <li>Membawa Kartu BPJS asli</li>\r\n <li>Membawa KTP asli</li>\r\n <li>Membawa Kartu Keluarga (bagi yang belum mempunyai KTP)</li>\r\n <li>Membawa Surat Kelahiran/Akte bagi pasien Anak (pasien baru)</li>\r\n <li>Membawa Surat Rujukan Asli dari FASKES (atau <strong>Surat Kontrol</strong> untuk kunjungan ulang)</li>\r\n</ul>\r\n\r\n<div style=\"background:#eee; border:1px solid #ccc; padding:5px 10px\"><em>*Dengan menekan tombol &quot;Daftar&quot;, maka pasien dianggap telah membaca, memahami, dan menyetujui seluruh syarat dan ketentuan di atas.</em></div>\r\n', 4, '0000-00-00 00:00:00', '2020-06-19 09:02:36', ''),
