(19, 'vket_antrian_res', '', 4, '0000-00-00 00:00:00', '2025-07-15 02:55:20', ''),
(20, 'vket_antrian_mesin', '<p>Silahkan menuju loket pendaftaran dan menunggu dipanggil sesuai nomor urut antrian anda. Pendaftaran dilayani berdasarkan abjad <strong>A</strong>: 07.00-12.00 | <strong>B</strong>: 12.00-20.00 | <strong>C</strong>: 07.00-20.00.<br />\r\n<strong>PENTING*</strong> Pasien WAJIB datang paling lambat 1 (satu) jam sebelum jam praktik dokter berakhir.<br />\r\nReservasi Online : <em><strong>hospital.umm.ac.id/pendaftaran</strong></em></p>\r\n', 4, '0000-00-00 00:00:00', '2019-11-04 04:13:13', ''),
(21, 'vket_antrian_poli', '<p>nomor antrian ini hanya dapat digunakan/berlaku pada<br />\r\ntanggal <strong>[tanggal]</strong> pukul <strong>[jam_awal] - [jam_akhir]</strong> WIB</p>', 4, '0000-00-00 00:00:00', '2019-10-24 10:27:54', ''),
